import React, { Component } from 'react';
import classes from '../InfoResidente/InfoResidente.css'

class infoCard extends Component 
{
    render(){
        return(
            <div className={classes['card']}>
                <img></img>
                <h4>Nombre:</h4>
                <p>telefono:</p>
                <p>Numero casa:</p>
                <span>Status:</span>
            </div>
        )
    }

}
export default infoCard
